export default {
  name: 'RouteInfo',
  computed: {
    route () {
      const { fullPath, hash, matched, meta, name, params, path, query } = this.$route
      return JSON.stringify({
        name,
        path,
        fullPath,
        params,
        query,
        meta,
        hash,
        matched: matched.map(m => ({
          path: m.path,
          name: m.name
        }))
      }, null, 2)
    }
  }
}
